import React, {Component} from 'react';
import {Grid} from 'react-mdl';

class About extends Component {
	render() {
		return(
			<div>
			  <Grid className='about-grid' shadow={5}>
					<Cell col={4}>

					</Cell>
				</Grid>
			</div>
		)
	}
}

export default About;
